import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { MatCardModule } from '@angular/material/card';
import { MatIconModule } from '@angular/material/icon';
import { MatDialog, MatDialogModule } from '@angular/material/dialog';
import { MatButtonModule } from '@angular/material/button';
import { EditUserDetailsComponent } from './edit-user-details/edit-user-details.component';
import { Router } from '@angular/router';

@Component({
  selector: 'app-user-details',
  standalone: true,
  imports: [
    CommonModule,
    MatCardModule,
    MatIconModule,
    MatButtonModule,
    MatDialogModule,
    MatIconModule,
  ],
  templateUrl: './user-details.component.html',
  styleUrls: ['./user-details.component.css'],
})
export class UserDetailsComponent {
  constructor(public dialog: MatDialog, private router: Router) {}

  openUserAdressEditPopup(): void {
    const dialogRef = this.dialog.open(EditUserDetailsComponent, {
      data: { name: 'name', animal: 'animal' },
    });

    dialogRef.afterClosed().subscribe((result) => {
      console.log('The dialog was closed: ', result);
    });
  }

  switchUser(): void {
    this.router.navigate(['/login']);
  }
}
<mat-card class="user-details">
  <mat-card-header>
    <mat-card-title>Hi, John Doe</mat-card-title>
  </mat-card-header>

  <mat-card-content>
    <p>ID: 123456789</p>
    <div>
      <p>Address: New York, Broadway 123, Apt 4, 10001</p>
      <button
        mat-raised-button
        color="primary"
        (click)="openUserAdressEditPopup()"
      >
        change address <mat-icon>edit</mat-icon>
      </button>
      <br />
      <button
        mat-raised-button
        color="warn"
        (click)="switchUser()"
        class="switch-user"
      >
        switch user <mat-icon>logout</mat-icon>
      </button>
    </div>
  </mat-card-content>
</mat-card>
